@props(['reconocimiento'])

<div x-data="{
        open: false,
        list()
        {
            this.open =!this.open;
            this.listEvent();
        },
        listEvent()
        {
            if(this.open === true){
                const elem = document.querySelectorAll('#dropIcon ul li:not(:first-child)');
                elem.forEach(item => {
                    item.addEventListener('click', () => {
                        let val = item.getAttribute('data-value');
                        this.data = val
                        this.addIcon()
                    });
                });
            }
        },
        addIcon()
        {
            const clases = this.data
            const elem = document.querySelector('#icon')
            const iconElement = `<i  class='text-6xl text-shadow ${clases}' style='color: ${this.color}'></i>  <span class='text-black font-semibold text-xl'>${clases}</span>`
            elem.innerHTML = iconElement
            this.closeDropDown()
        },
        closeDropDown()
        {
            this.open = false
        }
    }" 
    class="relative"
    id="dropIcon"
>
    @if (empty($reconocimiento->icon))   
        <div class="w-50 h-50 mb-3 flex items-center gap-x-10" id="icon" x-ref="color"></div>
    @else
        <div class="w-50 h-50 mb-3 flex items-center gap-x-10" id="icon" x-ref="color">
            <i  class='text-6xl text-shadow {{ $reconocimiento->icon }}' style='color: {{ $reconocimiento->color }}'></i>  <span class='text-black font-semibold text-xl'>{{ $reconocimiento->icon }}</span>
        </div>
    @endif
    <div @click="list()"  class="px-6 py-3 cursor-pointer border border-black rounded-md">
